function ClassCard({ cls }) {
  return (
    <div className="card">
      <h3>{cls.subject}</h3>
      <p>Grade: {cls.grade}</p>
      <p>Teacher: {cls.teacher}</p>
      <p>Fee: Rs.{cls.fee}</p>
    </div>
  );
}

export default ClassCard;
